script: |
  super -f text -I q7162.spq | sort > q7162.out

inputs:
  - name: q7162.spq
    data: |
      SELECT DISTINCT + col0 AS col1 FROM tab0 (FORMAT parquet) WHERE NOT ( ( - col1 ) BETWEEN - col0 * - 1 * + col0 * - 17 / - col1 AND + 45 );
  - name: tab0

outputs:
  - name: q7162.out
    data: |
      15
      87
      97
